about = "Параметры\nИмя: Аэлита\nВозраст: 32\nНациональность: Узбечка\nВес (кг.): 80\nРост (см.): 175\nГрудь: 5\n\nЗдравствуйте, мои ребята! Несколько слов о самой себе: безупречно раздетая, циничная, но одновременно с этим очень любящая сексуальные развлечения, голых мужиков с упругими попками и хороший алкоголь. Предпочту проводить время в веселой компании с молодыми и юными обеспеченными ребятами."
